import "./App.css";
import { Button } from "react-bootstrap";
import { Navbar } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="App">
      <Navbar bg="orange" sticky="top">
        <Navbar.Brand href="#home">the salad bowl</Navbar.Brand>
      </Navbar>
      <Button>Hello World</Button>
    </div>
  );
}

export default App;
